export default function Dashboard(){
    const logout = () => {
        //alert("Loggin out ... ");
        sessionStorage.removeItem('userID');
        window.location.reload();
    }

    return(
        <>
        <h1>Dashboard</h1>
        <LogoutButton/>
        </>
    );
    
    function LogoutButton(){
        return(
            <button onClick={logout} className="btn btn-danger">Logout</button>
        );
    }
}
